pragma solidity ^0.4.17;

import "zeppelin-solidity/contracts/token/ERC721/ERC721.sol";

contract TokenMarket {
    ERC721 public nonFungibleContract;

    struct Listing {
      address seller;
      uint128 price;
    }

    mapping (uint256 => Listing) public tokenIdToListing;

    function TokenMarket(address _nftAddress) public {
        nonFungibleContract = ERC721(_nftAddress);
    }

    function createListing( uint256 _tokenId, uint128 _price ) public {
      nonFungibleContract.takeOwnership(_tokenId);
      Listing memory _listing = Listing({
         seller: msg.sender,
         price: uint128(_price)
      });
      tokenIdToListing[_tokenId] = _listing;
    }

    function buy( uint256 _tokenId ) public payable {
      Listing memory listing = tokenIdToListing[_tokenId];
      require(listing.seller != address(0));
      require(msg.value >= listing.price);

      address seller = listing.seller;
      uint128 price = listing.price;

      delete tokenIdToListing[_tokenId];

      seller.transfer(price);
      nonFungibleContract.transfer(msg.sender, _tokenId);
    }

    function cancel( uint256 _tokenId ) public {
      Listing memory listing = tokenIdToListing[_tokenId];
      require(listing.seller == msg.sender);

      delete tokenIdToListing[_tokenId];

      nonFungibleContract.transfer(msg.sender, _tokenId);
    }
}
